import Slider from "../components/Slider";

function Home() {
  const name = "Chandan";

  return (
    <div className="">
      <Slider />
      <div className="container mx-auto grid h-full gap-10 min-h-[60vh] w-full grid-cols-1 items-center lg:grid-cols-2">
        <div className="row-start-2 lg:row-auto">
          <h1 className="block antialiased tracking-normal font-sans font-semibold text-blue-gray-900 mb-4 lg:text-5xl !leading-tight text-3xl">
             Welcome to my Web<br></br>
Development Portofolio!
          </h1>
          <p>
            I am a UI Developer with 9 years of experience in creating clean, responsive, and user-friendly web designs. I completed my MCA in 2015 and am currently working at ITH Technologies.<br></br>

I work mainly with HTML5, CSS3, JavaScript, ReactJS, Angular, Bootstrap, and Material UI to build websites and web applications. I enjoy turning designs into real, working websites that look good on all devices.<br></br>

I always try to learn new things and improve my skills. I believe in writing clean code and working closely with my team to deliver the best user experience.


          </p>

        </div>
        </div>     
    </div>
  );
}

export default Home;
